import React from 'react'
import img_avatar from '../img/img_avatar.png'
const Contact = ({name, place, phone}) => {
    return (
        <>
            <div className="card">
                <img src={img_avatar} alt="img" style={{width: 100}}/>
            </div>
        </>
    )
}

export default Contact
